import React from 'react';
import Calendario from '../../components/Calendario';
import * as C from './styles';

const Home = () => {
    return (
        <C.Container>
            <C.Navbar>

            </C.Navbar>
            <C.CalendarContent>
                <Calendario />
            </C.CalendarContent>
            <C.DateInfoContent>
                Informações do calendario
            </C.DateInfoContent>
        </C.Container>
    )
}

export default Home
